package com.blumeglobal.shipmentevents.processor.utils;

import com.blumeglobal.shipmentevents.processor.enums.DataSizeEnum;

public class DataUtils {

    public static String getData(DataSizeEnum dataSizeEnum){
       if (dataSizeEnum.equals(DataSizeEnum.BIG)){
            return "BIG DATA : 10k characters ";
        } else if (dataSizeEnum.equals(DataSizeEnum.MEDIUM)){
            return "MEDIUM DATA : 1k characters ";
        } else {
            return "SMALL DATA : 100 characters 0123456789ABCDEFGHIJKLMNOPQRSTUVXYZabcdefghijklmnopqrstuvwxyz01234";
        }
    }
}
